import React, { Component } from "react";

export default class TalentRow extends Component {
  render() {
    return (
      <div>
        <tr>
          <th scope="row">1</th>
          {this.props.randomHero.talents[1].map(talent => (
            <Talent
              key={uuidv4()}
              talent={talent.icon}
              randomHero={this.props.randomHero}
              selected={talent.sort === randomNumber ? true : false}
            />
          ))}
        </tr>
      </div>
    );
  }
}
